import React, { useState } from 'react'
import './App.css'

export default function CardDisplay() {

    const [count, setCount] = useState(1);

    return (
        <div>
            <h3>Card Result Page</h3>
            <button onClick={() => setCount(count + 1)}>Increase Count</button>
            <div>Count: {count}</div>
        </div>
    )
}
